import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom"
import Mainpage from "./components/mainpage"
import Contact from './components/contact';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Mainpage />
        <Routes>
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>

    </BrowserRouter>

  );
}

export default App;
